  ngOnInit() {
    this.loading = true;

    this.api.list('api/product/all', 0, data => {
        this.products = data.dataList;
        this.api.list('api/store/all', 0, data => {
            this.stores = data;
            this.api.list('api/category/all', 0, data => {
                this.categories = data;
                var cnt_data = [];
                var color_data = [];
                this.categories.forEach(category => {
                    var cnt = this.products.filter(item => item.categoryName === category.name).length;
                    if (cnt) {
                      this.chartLabels.push(category.name);
                      cnt_data.push(cnt);
                      // var color = this.randomColor();
                      // color_data.push(color);
                    }
                });
                this.chartDatasets.push({
                    data: cnt_data
                });
                // this.chartColors.push({
                //   backgroundColor: color_data,
                //   hoverBackgroundColor: color_data,
                //   borderWidth: 2,
                // });
                this.loading = false;
            });
        });
    });
    this.admin = this.authService.getUser();
  }
